import logo from './logo.svg';
import {useState} from 'react'
import './App.css';
import Example from './Example'
function App() {
  const [name, setName] = useState('');
  nameChange = (event)=>{
    setName(event.target.value)
  }
  return (
    <div className="App">
      <input type="text" value={name} onChange={this.nameChange} />
      <Example name = {name}/>
    </div>
  );
}

export default App;
